--
-- Name: can_edit_event(uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.can_edit_event(event_id_param uuid) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    event_record RECORD;
    user_role TEXT;
BEGIN
    -- Buscar informações do evento
    SELECT * INTO event_record 
    FROM events 
    WHERE id = event_id_param;
    
    IF NOT FOUND THEN
        RETURN FALSE;
    END IF;
    
    -- Verificar se o usuário é o organizador
    IF event_record.organizer_id = auth.uid() THEN
        -- Verificar se o evento pode ser editado
        IF event_record.end_date IS NOT NULL AND event_record.end_date <= NOW() THEN
            RETURN FALSE; -- Evento já finalizado
        END IF;
        
        -- Verificar se há ingressos vendidos (opcional - pode ser configurável)
        IF EXISTS (
            SELECT 1 FROM tickets 
            WHERE event_id = event_id_param 
            AND status = 'sold'
        ) THEN
            -- Pode editar mas com restrições
            RETURN TRUE;
        END IF;
        
        RETURN TRUE;
    END IF;
    
    -- Verificar se é admin
    SELECT raw_user_meta_data->>'role' INTO user_role
    FROM auth.users 
    WHERE id = auth.uid();
    
    IF user_role = 'admin' THEN
        RETURN TRUE;
    END IF;
    
    RETURN FALSE;
END;
$$;


