--
-- Name: can_transfer_ticket(uuid, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.can_transfer_ticket(p_ticket_id uuid, p_user_id uuid) RETURNS json
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_ticket_record RECORD;
  v_result JSON;
BEGIN
  -- Buscar informações do ingresso
  SELECT 
    t.id,
    t.event_id,
    t.user_id,
    t.ticket_user_id,
    t.status,
    t.transfer_count,
    COALESCE(ett.max_transfers, 1) as max_transfers,
    COALESCE(ett.transferable, true) as transferable,
    e.title as event_title,
    e.start_date,
    e.status as event_status
  INTO v_ticket_record
  FROM tickets t
  LEFT JOIN event_ticket_types ett ON t.ticket_type_id = ett.id
  JOIN events e ON t.event_id = e.id
  WHERE t.id = p_ticket_id;
  
  -- Verificar se o ingresso existe
  IF NOT FOUND THEN
    RETURN json_build_object(
      'can_transfer', false,
      'message', 'Ingresso não encontrado'
    );
  END IF;
  
  -- Verificar se o ingresso tem um proprietário definido (ticket_user_id)
  IF v_ticket_record.ticket_user_id IS NULL THEN
    RETURN json_build_object(
      'can_transfer', false,
      'message', 'Este ingresso não pode ser transferido pois não possui proprietário definido'
    );
  END IF;
  
  -- Verificar se o ingresso pertence ao usuário atual (user_id)
  IF v_ticket_record.user_id != p_user_id THEN
    RETURN json_build_object(
      'can_transfer', false,
      'message', 'Você não possui este ingresso'
    );
  END IF;
  
  -- Verificar se o tipo de ingresso permite transferência
  IF NOT v_ticket_record.transferable THEN
    RETURN json_build_object(
      'can_transfer', false,
      'message', 'Este tipo de ingresso não permite transferência'
    );
  END IF;
  
  -- Verificar se o ingresso já foi transferido o máximo de vezes
  IF v_ticket_record.transfer_count >= v_ticket_record.max_transfers THEN
    RETURN json_build_object(
      'can_transfer', false,
      'message', 'Este ingresso já atingiu o limite máximo de transferências'
    );
  END IF;
  
  -- Verificar se o evento ainda não começou
  IF v_ticket_record.start_date <= NOW() THEN
    RETURN json_build_object(
      'can_transfer', false,
      'message', 'Não é possível transferir ingressos para eventos que já começaram'
    );
  END IF;
  
  -- Verificar se o evento está aprovado
  IF v_ticket_record.event_status != 'approved' THEN
    RETURN json_build_object(
      'can_transfer', false,
      'message', 'Evento não está disponível para transferência'
    );
  END IF;
  
  -- Verificar se o ingresso tem status válido
  IF v_ticket_record.status NOT IN ('active', 'confirmed') THEN
    RETURN json_build_object(
      'can_transfer', false,
      'message', 'Este ingresso não pode ser transferido no momento'
    );
  END IF;
  
  -- Se chegou até aqui, pode transferir
  RETURN json_build_object(
    'can_transfer', true,
    'message', 'Ingresso pode ser transferido',
    'data', json_build_object(
      'ticket_id', p_ticket_id,
      'current_transfers', v_ticket_record.transfer_count,
      'max_transfers', v_ticket_record.max_transfers,
      'remaining_transfers', v_ticket_record.max_transfers - v_ticket_record.transfer_count
    )
  );
END;
$$;


ALTER FUNCTION public.can_transfer_ticket(p_ticket_id uuid, p_user_id uuid) OWNER TO postgres;

--
-- Name: check_auto_withdrawal_conditions(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.check_auto_withdrawal_conditions() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    withdrawal_record RECORD;
    total_sales DECIMAL(10,2) := 0;
    sales_count INTEGER := 0;
    days_since_last INTEGER := 0;
BEGIN
         -- Buscar o organizador do evento da transação
     DECLARE
         event_organizer_id UUID;
     BEGIN
         SELECT e.organizer_id INTO event_organizer_id
         FROM events e
         WHERE e.id = NEW.event_id;
         
         IF event_organizer_id IS NULL THEN
             RETURN NEW;
         END IF;
         
         -- Buscar configurações de saque automático
         FOR withdrawal_record IN 
             SELECT * FROM withdrawals 
             WHERE auto_withdrawal_enabled = true 
             AND organizer_id = event_organizer_id
             AND status = 'pendente'
         LOOP
        -- Verificar gatilho por valor de vendas
        IF withdrawal_record.auto_trigger_type = 'sales_amount' 
           AND withdrawal_record.sales_amount_trigger IS NOT NULL THEN
            
                         SELECT COALESCE(SUM(t.total_amount), 0) INTO total_sales
             FROM transactions t
             JOIN events e ON t.event_id = e.id
             WHERE e.organizer_id = withdrawal_record.organizer_id 
             AND t.created_at >= COALESCE(withdrawal_record.last_auto_execution, '1970-01-01'::timestamp);
            
            IF total_sales >= withdrawal_record.sales_amount_trigger THEN
                -- Executar saque automático
                PERFORM execute_auto_withdrawal(withdrawal_record.id);
            END IF;
        END IF;
        
        -- Verificar gatilho por contador de vendas
        IF withdrawal_record.auto_trigger_type = 'sales_count' 
           AND withdrawal_record.sales_count_trigger IS NOT NULL THEN
            
                         SELECT COUNT(*) INTO sales_count
             FROM transactions t
             JOIN events e ON t.event_id = e.id
             WHERE e.organizer_id = withdrawal_record.organizer_id 
             AND t.created_at >= COALESCE(withdrawal_record.last_auto_execution, '1970-01-01'::timestamp);
            
            IF sales_count >= withdrawal_record.sales_count_trigger THEN
                -- Executar saque automático
                PERFORM execute_auto_withdrawal(withdrawal_record.id);
            END IF;
        END IF;
        
        -- Verificar gatilho por intervalo de tempo
        IF withdrawal_record.auto_trigger_type = 'time_interval' 
           AND withdrawal_record.time_interval_days IS NOT NULL THEN
            
            IF withdrawal_record.last_auto_execution IS NULL THEN
                -- Primeira execução
                UPDATE withdrawals 
                SET next_scheduled_execution = NOW() + INTERVAL '1 day' * withdrawal_record.time_interval_days
                WHERE id = withdrawal_record.id;
            ELSE
                days_since_last := EXTRACT(DAY FROM (NOW() - withdrawal_record.last_auto_execution));
                
                IF days_since_last >= withdrawal_record.time_interval_days THEN
                    -- Executar saque automático
                    PERFORM execute_auto_withdrawal(withdrawal_record.id);
                END IF;
            END IF;
                 END IF;
     END LOOP;
     END;
     
     RETURN NEW;
END;
$$;


ALTER FUNCTION public.check_auto_withdrawal_conditions() OWNER TO postgres;

--
-- Name: checkin_by_qr_code(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.checkin_by_qr_code(p_qr_code text) RETURNS json
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_ticket_user RECORD;
    v_ticket RECORD;
    v_event RECORD;
    v_existing_checkin RECORD;
    v_organizer_id UUID;
    v_checkin_id UUID;
    v_start_time TIMESTAMP;
    v_current_step TEXT;
    v_ticket_type RECORD;
BEGIN
    v_start_time := NOW();
    v_current_step := 'inicio';
    
    -- 1. Buscar ticket_user pelo QR Code
    v_current_step := 'buscar_ticket_user';
    SELECT * INTO v_ticket_user
    FROM ticket_users 
    WHERE qr_code = p_qr_code
    ORDER BY created_at DESC 
    LIMIT 1;
    
    IF NOT FOUND THEN
        RETURN json_build_object(
            'success', false,
            'error', 'TICKET_NOT_FOUND',
            'message', 'Ticket não encontrado',
            'debug', json_build_object('qr_code', p_qr_code, 'step', v_current_step)
        );
    END IF;
    
    -- 2. Buscar ticket
    v_current_step := 'buscar_ticket';
    SELECT * INTO v_ticket
    FROM tickets 
    WHERE id = v_ticket_user.ticket_id
    LIMIT 1;
    
    IF NOT FOUND THEN
        RETURN json_build_object(
            'success', false,
            'error', 'TICKET_NOT_FOUND',
            'message', 'Dados do ticket não encontrados',
            'debug', json_build_object('ticket_user_id', v_ticket_user.id, 'step', v_current_step)
        );
    END IF;
    
    -- 3. Buscar tipo de ingresso (catálogo)
    v_current_step := 'buscar_ticket_type';
    SELECT * INTO v_ticket_type
    FROM ticket_types_with_batches 
    WHERE id = v_ticket.ticket_type_id
    LIMIT 1;
    
    -- 4. Buscar evento
    v_current_step := 'buscar_evento';
    SELECT * INTO v_event
    FROM events 
    WHERE id = v_ticket.event_id
    LIMIT 1;
    
    IF NOT FOUND THEN
        RETURN json_build_object(
            'success', false,
            'error', 'EVENT_NOT_FOUND',
            'message', 'Evento não encontrado',
            'debug', json_build_object('ticket_id', v_ticket.id, 'step', v_current_step)
        );
    END IF;
    
    -- 5. Verificar check-in existente
    v_current_step := 'verificar_checkin_existente';
    SELECT * INTO v_existing_checkin
    FROM checkin 
    WHERE ticket_user_id = v_ticket_user.id
    ORDER BY created_at DESC 
    LIMIT 1;
    
    IF FOUND THEN
        RETURN json_build_object(
            'success', true,
            'action', 'ALREADY_CHECKED_IN',
            'message', 'Participante já fez check-in anteriormente',
            'data', json_build_object(
                'name', COALESCE(v_ticket_user.name, 'Participante'),
                'email', COALESCE(v_ticket_user.email, ''),
                'event_title', COALESCE(v_event.title, 'Evento não informado'),
                'event_date', v_event.start_date,
                'event_location', COALESCE(
                    v_event.location,
                    v_event.location_name || ' - ' || v_event.location_city || '/' || v_event.location_state,
                    'Local não informado'
                ),
                'ticket_type', COALESCE(
                    v_ticket.ticket_type_name,
                    v_ticket_type.title,
                    v_ticket_type.name,
                    v_event.ticket_type,
                    'Ingresso não informado'
                ),
                'ticket_area', COALESCE(
                    v_ticket.ticket_area,
                    v_ticket_type.area,
                    'Área não informada'
                ),
                'ticket_price', COALESCE(
                    v_ticket.price,
                    v_ticket.original_price,
                    v_ticket_type.price,
                    v_event.price,
                    0
                ),
                'ticket_price_feminine', COALESCE(
                    v_ticket.price_feminine,
                    v_ticket_type.price_feminine,
                    v_ticket.price,
                    0
                ),
                'ticket_description', COALESCE(
                    v_ticket.description,
                    v_ticket_type.description,
                    ''
                ),
                'ticket_batch_name', COALESCE(
                    v_ticket.batch_name,
                    v_ticket_type.batches->0->>'name',
                    ''
                ),
                'checked_in_at', v_existing_checkin.created_at,
                'status', 'ALREADY_CHECKED_IN',
                'is_checked_in', true
            )
        );
    END IF;
    
    -- 6. Determinar organizer_id
    v_current_step := 'determinar_organizer';
    v_organizer_id := v_event.organizer_id;
    IF v_organizer_id IS NULL THEN
        v_organizer_id := v_event.created_by;
    END IF;
    
    -- 7. Realizar check-in
    v_current_step := 'realizar_checkin';
    INSERT INTO checkin (
        ticket_user_id,
        event_id,
        organizer_id,
        notes,
        created_at,
        updated_at
    ) VALUES (
        v_ticket_user.id,
        v_event.id,
        v_organizer_id,
        'Check-in automático via QR Scanner - ' || p_qr_code,
        NOW(),
        NOW()
    ) RETURNING id INTO v_checkin_id;
    
    -- 8. Retornar sucesso
    RETURN json_build_object(
        'success', true,
        'action', 'CHECK_IN_COMPLETED',
        'message', 'Check-in realizado com sucesso!',
        'data', json_build_object(
            'name', COALESCE(v_ticket_user.name, 'Participante'),
            'email', COALESCE(v_ticket_user.email, ''),
            'event_title', COALESCE(v_event.title, 'Evento não informado'),
            'event_date', v_event.start_date,
            'event_location', COALESCE(
                v_event.location,
                v_event.location_name || ' - ' || v_event.location_city || '/' || v_event.location_state,
                'Local não informado'
            ),
            'ticket_type', COALESCE(
                v_ticket.ticket_type_name,
                v_ticket_type.title,
                v_ticket_type.name,
                v_event.ticket_type,
                'Ingresso não informado'
            ),
            'ticket_area', COALESCE(
                v_ticket.ticket_area,
                v_ticket_type.area,
                'Área não informada'
            ),
            'ticket_price', COALESCE(
                v_ticket.price,
                v_ticket.original_price,
                v_ticket_type.price,
                v_event.price,
                0
            ),
            'ticket_price_feminine', COALESCE(
                v_ticket.price_feminine,
                v_ticket_type.price_feminine,
                v_ticket.price,
                0
            ),
            'ticket_description', COALESCE(
                v_ticket.description,
                v_ticket_type.description,
                ''
            ),
            'ticket_batch_name', COALESCE(
                v_ticket.batch_name,
                v_ticket_type.batches->0->>'name',
                ''
            ),
            'checked_in_at', NOW(),
            'status', 'CHECKED_IN',
            'checkin_id', v_checkin_id,
            'organizer_id', v_organizer_id,
            'is_checked_in', true
        ),
        'timing', json_build_object(
            'total_ms', EXTRACT(EPOCH FROM (NOW() - v_start_time)) * 1000,
            'completed_at', NOW()
        )
    );

EXCEPTION
    WHEN OTHERS THEN
        RETURN json_build_object(
            'success', false,
            'error', 'SYSTEM_ERROR',
            'message', 'Erro interno: ' || SQLERRM,
            'debug', json_build_object('step', v_current_step, 'error_message', SQLERRM, 'error_state', SQLSTATE)
        );
END;
$$;


