--
-- Name: create_ticket_user(uuid, text, text, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.create_ticket_user(p_ticket_id uuid, p_name text, p_email text, p_document text DEFAULT NULL::text) RETURNS uuid
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_qr_code text;
    v_new_id uuid;
BEGIN
    -- Verifica se o ticket existe e pega o QR Code
    SELECT qr_code INTO v_qr_code
    FROM public.tickets
    WHERE id = p_ticket_id;

    IF v_qr_code IS NULL THEN
        RAISE EXCEPTION 'Ticket não encontrado ou sem QR Code.';
    END IF;

    -- Cria o ticket_user vinculado ao ticket
    INSERT INTO public.ticket_users (ticket_id, name, email, document, qr_code)
    VALUES (p_ticket_id, p_name, p_email, p_document, v_qr_code)
    RETURNING id INTO v_new_id;

    RETURN v_new_id;
END;
$$;


ALTER FUNCTION public.create_ticket_user(p_ticket_id uuid, p_name text, p_email text, p_document text) OWNER TO postgres;

--
-- Name: create_ticket_user(uuid, text, text, text, text, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.create_ticket_user(p_ticket_id uuid DEFAULT NULL::uuid, p_ticket_code text DEFAULT NULL::text, p_qr_code text DEFAULT NULL::text, p_name text DEFAULT NULL::text, p_email text DEFAULT NULL::text, p_document text DEFAULT NULL::text) RETURNS uuid
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_ticket_id uuid;
    v_qr_code text;
    v_new_id uuid;
BEGIN
    -- garantir search_path seguro
    PERFORM set_config('search_path', 'public,pg_catalog', true);

    -- 1) Prioriza p_ticket_id se informado
    IF p_ticket_id IS NOT NULL THEN
        v_ticket_id := p_ticket_id;
    ELSE
        -- 2) Tenta localizar por qr_code
        IF p_qr_code IS NOT NULL THEN
            SELECT id INTO v_ticket_id FROM public.tickets WHERE qr_code = p_qr_code LIMIT 1;
        END IF;

        -- 3) Se não encontrado, tenta por code
        IF v_ticket_id IS NULL AND p_ticket_code IS NOT NULL THEN
            SELECT id INTO v_ticket_id FROM public.tickets WHERE code = p_ticket_code LIMIT 1;
        END IF;
    END IF;

    -- Se não encontrou, falha com mensagem clara
    IF v_ticket_id IS NULL THEN
        RAISE EXCEPTION 'Ticket não encontrado. Forneça p_ticket_id ou p_qr_code ou p_ticket_code válidos.';
    END IF;

    -- Pega o qr_code real do ticket (para consistência)
    SELECT qr_code INTO v_qr_code FROM public.tickets WHERE id = v_ticket_id;

    -- Insere o ticket_user vinculando corretamente ao ticket
    INSERT INTO public.ticket_users (ticket_id, name, email, document, qr_code, created_at, updated_at)
    VALUES (v_ticket_id, p_name, p_email, p_document, v_qr_code, now(), now())
    RETURNING id INTO v_new_id;

    -- Atualiza tickets.ticket_user_id para referência bidirecional (opcional, mas útil)
    UPDATE public.tickets
    SET ticket_user_id = v_new_id
    WHERE id = v_ticket_id;

    RETURN v_new_id;
END;
$$;


ALTER FUNCTION public.create_ticket_user(p_ticket_id uuid, p_ticket_code text, p_qr_code text, p_name text, p_email text, p_document text) OWNER TO postgres;

