-- Name: create_tickets(bigint, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.create_tickets(p_event_id bigint, p_user_id uuid) RETURNS TABLE(ticket_id bigint)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_ticket_id bigint;
BEGIN
    -- Validate input parameters
    IF p_event_id IS NULL OR p_user_id IS NULL THEN
        RAISE EXCEPTION 'Missing required transaction fields';
    END IF;

    -- Insert ticket and return the new ticket's ID
    INSERT INTO tickets (event_id, user_id)
    VALUES (p_event_id, p_user_id)
    RETURNING id INTO v_ticket_id;

    RETURN QUERY 
    SELECT v_ticket_id;
EXCEPTION 
    WHEN OTHERS THEN
        -- Log the error (requires logging extension)
        RAISE LOG 'Error in create_tickets: % %', SQLERRM, SQLSTATE;
        RAISE;
END;
$$;


