--
-- Name: create_tickets_after_payment(uuid, character varying); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.create_tickets_after_payment(p_order_id uuid, p_pagarme_order_id character varying DEFAULT NULL::character varying) RETURNS jsonb
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_order RECORD;
    v_ticket_code VARCHAR(8);
    v_qr_code VARCHAR(12);
    v_ticket_id UUID;
    v_ticket_user_id UUID;
    v_created_tickets INTEGER := 0;
    v_result JSONB := '{"success": false, "tickets_created": 0}';
    v_event_id UUID;
    v_ticket_quantity INTEGER;
    v_ticket_price DECIMAL(10,2);
    i INTEGER;
BEGIN
    -- Buscar dados do pedido
    SELECT * INTO v_order FROM orders WHERE id = p_order_id;
    
    IF NOT FOUND THEN
        v_result := jsonb_set(v_result, '{errors}', to_jsonb(array['Pedido não encontrado: ' || p_order_id]));
        RETURN v_result;
    END IF;
    
    -- Verificar se o pagamento foi aprovado
    IF v_order.payment_status != 'paid' THEN
        v_result := jsonb_set(v_result, '{errors}', to_jsonb(array['Pagamento não foi aprovado: ' || v_order.payment_status]));
        RETURN v_result;
    END IF;
    
    -- Extrair informações dos metadados
    v_event_id := (v_order.metadata->>'event_id')::UUID;
    v_ticket_quantity := COALESCE((v_order.metadata->>'quantity')::INTEGER, 1);
    v_ticket_price := COALESCE((v_order.metadata->>'ticket_price')::DECIMAL, 0);
    
    -- Se não temos event_id nos metadados, tentar buscar de order_items
    IF v_event_id IS NULL THEN
        -- Verificar se a coluna event_id existe em order_items
        IF EXISTS (
            SELECT 1 FROM information_schema.columns 
            WHERE table_name = 'order_items' AND column_name = 'event_id'
        ) THEN
            SELECT event_id INTO v_event_id 
            FROM order_items 
            WHERE order_id = v_order.id 
            LIMIT 1;
        END IF;
    END IF;
    
    -- Se ainda não temos event_id, usar um valor padrão ou pular
    IF v_event_id IS NULL THEN
        -- Tentar buscar o primeiro evento disponível (fallback)
        SELECT id INTO v_event_id FROM events LIMIT 1;
        
        IF v_event_id IS NULL THEN
            v_result := jsonb_set(v_result, '{errors}', to_jsonb(array['Nenhum evento encontrado']));
            RETURN v_result;
        END IF;
    END IF;
    
    -- Buscar quantidade real dos order_items se existirem
    IF EXISTS (
        SELECT 1 FROM information_schema.columns 
        WHERE table_name = 'order_items' AND column_name = 'quantity'
    ) THEN
        SELECT COALESCE(SUM(quantity), v_ticket_quantity) INTO v_ticket_quantity
        FROM order_items 
        WHERE order_id = v_order.id;
    END IF;
    
    -- Criar ingressos
    FOR i IN 1..v_ticket_quantity LOOP
        -- Gerar códigos únicos
        v_ticket_code := generate_ticket_code();
        v_qr_code := generate_qr_code();
        
        -- Criar ingresso (compatível com suas políticas)
        INSERT INTO tickets (
            event_id, order_id, code, qr_code, 
            price, status, created_at, buyer_id, user_id
        ) VALUES (
            v_event_id,
            v_order.id,
            v_ticket_code,
            v_qr_code,
            v_ticket_price,
            'active',
            NOW(),
            v_order.customer_id, -- Usar customer_id se disponível
            v_order.customer_id  -- Usar customer_id se disponível
        ) RETURNING id INTO v_ticket_id;
        
        -- Criar ticket_user com dados do comprador
        INSERT INTO ticket_users (
            ticket_id, name, email, document, qr_code, created_at
        ) VALUES (
            v_ticket_id,
            COALESCE(v_order.customer_name, 'Cliente'),
            COALESCE(v_order.customer_email, 'sem-email@local'),
            COALESCE(v_order.customer_document, '00000000000'),
            v_qr_code,
            NOW()
        ) RETURNING id INTO v_ticket_user_id;
        
        v_created_tickets := v_created_tickets + 1;
    END LOOP;
    
    -- Atualizar resultado
    v_result := jsonb_set(v_result, '{success}', 'true');
    v_result := jsonb_set(v_result, '{tickets_created}', to_jsonb(v_created_tickets));
    v_result := jsonb_set(v_result, '{order_id}', to_jsonb(v_order.id));
    
    RETURN v_result;
END;
$$;


