--
-- Name: generate_ticket_user_qr_code(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.generate_ticket_user_qr_code() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    professional_chars TEXT := 'ABCDEFGHIJKLMNOPQRSTUVWXYZ';
    numeric_chars TEXT := '0123456789';
    generated_prof_code TEXT;
BEGIN
    -- Generate professional code
    generated_prof_code := 
        substring(professional_chars from (floor(random() * 26) + 1) for 1) ||
        substring(professional_chars from (floor(random() * 26) + 1) for 1) ||
        substring(numeric_chars from (floor(random() * 10) + 1) for 1) ||
        substring(numeric_chars from (floor(random() * 10) + 1) for 1) ||
        substring(numeric_chars from (floor(random() * 10) + 1) for 1) ||
        substring(numeric_chars from (floor(random() * 10) + 1) for 1);

    -- Ensure unique professional code
    WHILE EXISTS (SELECT 1 FROM ticket_users WHERE professional_code = generated_prof_code) LOOP
        generated_prof_code := 
            substring(professional_chars from (floor(random() * 26) + 1) for 1) ||
            substring(professional_chars from (floor(random() * 26) + 1) for 1) ||
            substring(numeric_chars from (floor(random() * 10) + 1) for 1) ||
            substring(numeric_chars from (floor(random() * 10) + 1) for 1) ||
            substring(numeric_chars from (floor(random() * 10) + 1) for 1) ||
            substring(numeric_chars from (floor(random() * 10) + 1) for 1);
    END LOOP;

    NEW.professional_code := generated_prof_code;

    -- Generate QR Code
    NEW.qr_code := 'TKT-' || NEW.professional_code || '-' || NEW.id::TEXT;

    RETURN NEW;
END;
$$;


ALTER FUNCTION public.generate_ticket_user_qr_code() OWNER TO postgres;

--
-- Name: generate_unique_qr_code(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.generate_unique_qr_code() RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
    qr_code TEXT;
    exists_count INTEGER;
BEGIN
    LOOP
        -- Gerar código QR único (UUID + timestamp)
        qr_code := UPPER(SUBSTRING(gen_random_uuid()::TEXT FROM 1 FOR 8)) || '-' || 
                   EXTRACT(EPOCH FROM NOW())::BIGINT::TEXT;
        
        -- Verificar se já existe
        SELECT COUNT(*) INTO exists_count 
        FROM ticket_users 
        WHERE qr_code = qr_code;
        
        -- Se não existe, retornar
        IF exists_count = 0 THEN
            RETURN qr_code;
        END IF;
    END LOOP;
END;
$$;


ALTER FUNCTION public.generate_unique_qr_code() OWNER TO postgres;

