-- Name: get_current_active_batch(uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_current_active_batch(ticket_type_id_param uuid) RETURNS json
    LANGUAGE plpgsql
    AS $$
DECLARE
    current_batch JSON;
BEGIN
    SELECT json_build_object(
        'id', tb.id,
        'batch_number', tb.batch_number,
        'batch_name', tb.batch_name,
        'price_masculine', tb.price_masculine,
        'price_feminine', tb.price_feminine,
        'quantity', tb.quantity,
        'available_quantity', tb.available_quantity,
        'sale_start_date', tb.sale_start_date,
        'sale_end_date', tb.sale_end_date
    )
    INTO current_batch
    FROM ticket_batches tb
    WHERE tb.ticket_type_id = ticket_type_id_param
      AND tb.status = 'active'
      AND (tb.sale_start_date IS NULL OR tb.sale_start_date <= NOW())
      AND (tb.sale_end_date IS NULL OR tb.sale_end_date >= NOW())
      AND tb.available_quantity > 0
    ORDER BY tb.batch_number ASC
    LIMIT 1;

    RETURN COALESCE(current_batch, '{}'::json);
END;
$$;


