--
-- Name: get_event_participants(uuid, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_event_participants(p_event_id uuid, p_organizer_id uuid) RETURNS TABLE(ticket_user_id uuid, name text, email text, document text, ticket_type text, qr_code text, is_checked_in boolean, checkin_date timestamp with time zone)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        tu.id as ticket_user_id,
        tu.name,
        tu.email,
        tu.document,
        t.ticket_type,
        COALESCE(tu.qr_code, t.qr_code) as qr_code,
        (c.id IS NOT NULL) as is_checked_in,
        c.created_at as checkin_date
    FROM ticket_users tu
    JOIN tickets t ON t.ticket_user_id = tu.id
    LEFT JOIN checkin c ON c.ticket_user_id = tu.id AND c.event_id = p_event_id
    WHERE t.event_id = p_event_id
    ORDER BY tu.name;
    
EXCEPTION
    WHEN OTHERS THEN
        RAISE NOTICE 'Erro na função get_event_participants: %', SQLERRM;
        -- Versão simplificada
        RETURN QUERY
        SELECT 
            tu.id as ticket_user_id,
            tu.name,
            tu.email,
            tu.document,
            t.ticket_type,
            COALESCE(tu.qr_code, t.qr_code) as qr_code,
            FALSE as is_checked_in,
            NULL::TIMESTAMP WITH TIME ZONE as checkin_date
        FROM ticket_users tu
        JOIN tickets t ON t.ticket_user_id = tu.id
        WHERE t.event_id = p_event_id
        ORDER BY tu.name;
END $$;


