--
-- Name: log_ticket_user_changes(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.log_ticket_user_changes() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Log para INSERT
    IF TG_OP = 'INSERT' THEN
        INSERT INTO ticket_history (
            ticket_user_id, 
            ticket_id, 
            event_id,
            action_type, 
            action_description, 
            new_values,
            performed_at
        ) VALUES (
            NEW.id,
            NEW.ticket_id,
            (SELECT event_id FROM tickets WHERE id = NEW.ticket_id),
            'created',
            'Ticket user created',
            to_jsonb(NEW),
            NOW()
        );
        RETURN NEW;
    END IF;
    
    -- Log para UPDATE
    IF TG_OP = 'UPDATE' THEN
        INSERT INTO ticket_history (
            ticket_user_id, 
            ticket_id, 
            event_id,
            action_type, 
            action_description, 
            old_values,
            new_values,
            performed_at
        ) VALUES (
            NEW.id,
            NEW.ticket_id,
            (SELECT event_id FROM tickets WHERE id = NEW.ticket_id),
            'updated',
            'Ticket user updated',
            to_jsonb(OLD),
            to_jsonb(NEW),
            NOW()
        );
        RETURN NEW;
    END IF;
    
    -- Log para DELETE
    IF TG_OP = 'DELETE' THEN
        INSERT INTO ticket_history (
            ticket_user_id, 
            ticket_id, 
            event_id,
            action_type, 
            action_description, 
            old_values,
            performed_at
        ) VALUES (
            OLD.id,
            OLD.ticket_id,
            (SELECT event_id FROM tickets WHERE id = OLD.ticket_id),
            'cancelled',
            'Ticket user deleted',
            to_jsonb(OLD),
            NOW()
        );
        RETURN OLD;
    END IF;
    
    RETURN NULL;
END;
$$;


ALTER FUNCTION public.log_ticket_user_changes() OWNER TO postgres;

--
-- Name: migrate_existing_tickets(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.migrate_existing_tickets() RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
    ticket_record RECORD;
    updated_count INTEGER := 0;
BEGIN
    -- Migrar tickets existentes que têm ticket_type definido
    FOR ticket_record IN 
        SELECT t.id, t.ticket_type, t.event_id
        FROM tickets t
        WHERE t.ticket_type_name IS NULL 
        AND t.ticket_type IS NOT NULL
    LOOP
        -- Tentar encontrar o tipo correspondente
        UPDATE tickets 
        SET 
            ticket_type_name = ticket_record.ticket_type,
            ticket_area = COALESCE(ticket_record.ticket_type, 'Geral'),
            gender = 'unisex'
        WHERE id = ticket_record.id;
        
        updated_count := updated_count + 1;
    END LOOP;
    
    RETURN 'Migrados ' || updated_count || ' tickets existentes.';
END;
$$;


