--
-- Name: perform_checkin(text, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.perform_checkin(p_ticket_code text, p_organizer_id uuid) RETURNS TABLE(success boolean, message text, ticket_data jsonb, checkin_id uuid)
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $_$
DECLARE
  v_ticket RECORD;
  v_ticket_user RECORD;
  v_ticket_type_name TEXT;
  v_checkin_id UUID;
BEGIN
  -- Buscar o ticket pelo código
  SELECT 
    t.id,
    t.code,
    t.status,
    t.price,
    t.used_at,
    t.event_id,
    t.ticket_type_id,
    e.title as event_title,
    e.location,
    e.organizer_id
  INTO v_ticket
  FROM tickets t
  INNER JOIN events e ON e.id = t.event_id
  WHERE t.code = p_ticket_code
  AND e.organizer_id = p_organizer_id;

  IF NOT FOUND THEN
    RETURN QUERY SELECT FALSE, '❌ Ingresso não encontrado'::TEXT, NULL::JSONB, NULL::UUID;
    RETURN;
  END IF;

  -- Buscar nome do tipo de ingresso (tentar event_ticket_types primeiro)
  v_ticket_type_name := 'Ingresso';
  
  IF v_ticket.ticket_type_id IS NOT NULL THEN
    -- Tentar buscar de event_ticket_types
    SELECT COALESCE(title, name, 'Ingresso') INTO v_ticket_type_name
    FROM event_ticket_types
    WHERE id = v_ticket.ticket_type_id
    LIMIT 1;
    
    -- Se não encontrou, tentar da VIEW ticket_types_with_batches
    IF v_ticket_type_name = 'Ingresso' OR v_ticket_type_name IS NULL THEN
      SELECT COALESCE(title, name, 'Ingresso') INTO v_ticket_type_name
      FROM ticket_types_with_batches
      WHERE id = v_ticket.ticket_type_id
      LIMIT 1;
    END IF;
  END IF;

  -- Limpar sufixos de gênero usando REGEXP_REPLACE
  v_ticket_type_name := TRIM(REGEXP_REPLACE(
    COALESCE(v_ticket_type_name, 'Ingresso'),
    '\s*-?\s*(Feminino|Masculino|Unissex)\s*$',
    '',
    'i'
  ));
  
  -- Também remover parênteses
  v_ticket_type_name := TRIM(REGEXP_REPLACE(
    v_ticket_type_name,
    '\s*\((Feminino|Masculino|Unissex)\)\s*$',
    '',
    'i'
  ));

  IF v_ticket.status = 'used' THEN
    SELECT * INTO v_ticket_user
    FROM ticket_users
    WHERE ticket_id = v_ticket.id
    LIMIT 1;
    
    RETURN QUERY SELECT 
      FALSE, 
      '⚠️ CHECK-IN JÁ REALIZADO'::TEXT,
      jsonb_build_object(
        'participant_name', COALESCE(v_ticket_user.name, 'Não informado'),
        'participant_email', COALESCE(v_ticket_user.email, ''),
        'participant_document', COALESCE(v_ticket_user.document, ''),
        'event_name', v_ticket.event_title,
        'location', COALESCE(v_ticket.location, 'Local não informado'),
        'ticket_type', v_ticket_type_name,
        'ticket_price', COALESCE(v_ticket.price, 0),
        'checkin_date', v_ticket.used_at
      ),
      NULL::UUID;
    RETURN;
  END IF;

  IF v_ticket.status != 'active' THEN
    RETURN QUERY SELECT FALSE, '❌ Ingresso não está ativo'::TEXT, NULL::JSONB, NULL::UUID;
    RETURN;
  END IF;

  SELECT * INTO v_ticket_user
  FROM ticket_users
  WHERE ticket_id = v_ticket.id
  LIMIT 1;

  UPDATE tickets
  SET status = 'used',
      used_at = NOW()
  WHERE id = v_ticket.id;

  IF v_ticket_user.id IS NOT NULL THEN
    INSERT INTO checkin (
      ticket_user_id,
      event_id,
      organizer_id,
      notes,
      created_at,
      updated_at
    )
    VALUES (
      v_ticket_user.id,
      v_ticket.event_id,
      p_organizer_id,
      'Check-in via QR: ' || p_ticket_code,
      NOW(),
      NOW()
    )
    RETURNING id INTO v_checkin_id;
  END IF;

  RETURN QUERY SELECT 
    TRUE,
    '✅ ACESSO LIBERADO'::TEXT,
    jsonb_build_object(
      'participant_name', COALESCE(v_ticket_user.name, 'Não informado'),
      'participant_email', COALESCE(v_ticket_user.email, ''),
      'participant_document', COALESCE(v_ticket_user.document, ''),
      'event_name', v_ticket.event_title,
      'location', COALESCE(v_ticket.location, 'Local não informado'),
      'ticket_type', v_ticket_type_name,
      'ticket_price', COALESCE(v_ticket.price, 0),
      'checkin_date', NOW()
    ),
    v_checkin_id;
END;
$_$;


ALTER FUNCTION public.perform_checkin(p_ticket_code text, p_organizer_id uuid) OWNER TO postgres;

--
-- Name: perform_participant_checkin(uuid, uuid, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.perform_participant_checkin(p_ticket_user_id uuid, p_event_id uuid, p_organizer_id uuid) RETURNS TABLE(success boolean, message text, participant_info jsonb)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_ticket_user_record RECORD;
    v_event_record RECORD;
    v_existing_checkin RECORD;
    v_checkin_id UUID;
BEGIN
    RAISE NOTICE 'perform_participant_checkin: ticket_user_id=%, event_id=%, organizer_id=%', p_ticket_user_id, p_event_id, p_organizer_id;
    
    -- 1. Verificar se o evento existe e pertence ao organizador
    SELECT * INTO v_event_record 
    FROM events 
    WHERE id = p_event_id AND organizer_id = p_organizer_id;
    
    IF NOT FOUND THEN
        RETURN QUERY SELECT 
            FALSE as success,
            'Evento não encontrado ou sem permissão' as message,
            jsonb_build_object(
                'error_code', 'event_not_found',
                'ticket_user_id', p_ticket_user_id,
                'event_id', p_event_id
            ) as participant_info;
        RETURN;
    END IF;
    
    -- 2. Buscar ticket_user
    SELECT tu.*, t.event_id, t.ticket_type, t.id as ticket_id
    INTO v_ticket_user_record
    FROM ticket_users tu
    JOIN tickets t ON t.ticket_user_id = tu.id
    WHERE tu.id = p_ticket_user_id
    AND t.event_id = p_event_id;
    
    IF NOT FOUND THEN
        RETURN QUERY SELECT 
            FALSE as success,
            'Participante não encontrado para este evento' as message,
            jsonb_build_object(
                'error_code', 'participant_not_found',
                'ticket_user_id', p_ticket_user_id,
                'event_id', p_event_id
            ) as participant_info;
        RETURN;
    END IF;
    
    -- 3. Verificar se já foi feito check-in
    SELECT * INTO v_existing_checkin
    FROM checkin 
    WHERE ticket_user_id = p_ticket_user_id 
    AND event_id = p_event_id;
    
    IF FOUND THEN
        RETURN QUERY SELECT 
            FALSE as success,
            'Check-in já foi realizado anteriormente' as message,
            jsonb_build_object(
                'error_code', 'already_checked',
                'participant_name', v_ticket_user_record.name,
                'participant_email', v_ticket_user_record.email,
                'ticket_type', v_ticket_user_record.ticket_type,
                'event_title', v_event_record.title,
                'checkin_date', v_existing_checkin.created_at,
                'already_checked', true
            ) as participant_info;
        RETURN;
    END IF;
    
    -- 4. Realizar check-in
    INSERT INTO checkin (
        id,
        ticket_user_id,
        event_id,
        organizer_id,
        created_at
    ) VALUES (
        gen_random_uuid(),
        p_ticket_user_id,
        p_event_id,
        p_organizer_id,
        NOW()
    ) RETURNING id INTO v_checkin_id;
    
    -- 5. Retornar sucesso
    RETURN QUERY SELECT 
        TRUE as success,
        'Check-in realizado com sucesso!' as message,
        jsonb_build_object(
            'checkin_id', v_checkin_id,
            'participant_name', v_ticket_user_record.name,
            'participant_email', v_ticket_user_record.email,
            'participant_document', v_ticket_user_record.document,
            'ticket_type', v_ticket_user_record.ticket_type,
            'event_title', v_event_record.title,
            'checkin_date', NOW(),
            'ticket_id', v_ticket_user_record.ticket_id
        ) as participant_info;
    
EXCEPTION
    WHEN OTHERS THEN
        RAISE NOTICE 'Erro na função perform_participant_checkin: %', SQLERRM;
        RETURN QUERY SELECT 
            FALSE as success,
            'Erro interno durante o check-in: ' || SQLERRM as message,
            jsonb_build_object(
                'error_code', 'internal_error',
                'error_details', SQLERRM,
                'ticket_user_id', p_ticket_user_id
            ) as participant_info;
        RETURN;
END $$;


