-- Name: process_image_upload(text, text, bytea); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.process_image_upload(bucket_name text, file_path text, file_data bytea) RETURNS text
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
declare
  file_url text;
begin
  -- Inserir o arquivo no storage
  insert into storage.objects (
    bucket_id,
    name,
    owner,
    size,
    metadata
  )
  values (
    bucket_name,
    file_path,
    auth.uid(),
    octet_length(file_data),
    jsonb_build_object(
      'mimetype', 'image/jpeg',
      'uploaded_by', auth.uid(),
      'uploaded_at', now()
    )
  )
  returning storage.url_path(bucket_id, name) into file_url;

  return file_url;
end;
$$;


