--
-- Name: search_event_participants(uuid, uuid, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.search_event_participants(p_event_id uuid, p_organizer_id uuid, p_search_term text DEFAULT NULL::text) RETURNS TABLE(ticket_user_id uuid, name text, email text, document text, ticket_id uuid, ticket_type text, already_checked_in boolean, checkin_date timestamp with time zone)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
  RETURN QUERY
  SELECT 
    tu.id as ticket_user_id,
    tu.name,
    tu.email,
    tu.document,
    t.id as ticket_id,
    COALESCE(t.ticket_type, 'Padrão') as ticket_type,
    (c.id IS NOT NULL) as already_checked_in,
    c.created_at as checkin_date
  FROM ticket_users tu
  JOIN tickets t ON t.ticket_user_id = tu.id
  JOIN events e ON t.event_id = e.id  -- APENAS event_id, removido t.event
  LEFT JOIN checkin c ON c.ticket_user_id = tu.id
  WHERE e.id = p_event_id
    AND e.organizer_id = p_organizer_id
    AND (
      p_search_term IS NULL OR
      LOWER(tu.name) LIKE '%' || LOWER(p_search_term) || '%' OR
      LOWER(tu.email) LIKE '%' || LOWER(p_search_term) || '%' OR
      LOWER(COALESCE(tu.document, '')) LIKE '%' || LOWER(p_search_term) || '%' OR
      tu.id::TEXT = p_search_term
    )
  ORDER BY tu.name;
END;
$$;


ALTER FUNCTION public.search_event_participants(p_event_id uuid, p_organizer_id uuid, p_search_term text) OWNER TO postgres;

--
-- Name: search_participants_by_text(text, uuid, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.search_participants_by_text(p_search_text text, p_event_id uuid, p_organizer_id uuid) RETURNS TABLE(ticket_user_id uuid, name text, email text, document text, ticket_type text, qr_code text, is_checked_in boolean, checkin_date timestamp with time zone)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
    RAISE NOTICE 'search_participants_by_text: search=%, event_id=%', p_search_text, p_event_id;
    
    RETURN QUERY
    SELECT 
        tu.id as ticket_user_id,
        tu.name,
        tu.email,
        tu.document,
        t.ticket_type,
        COALESCE(tu.qr_code, t.qr_code) as qr_code,
        (c.id IS NOT NULL) as is_checked_in,
        c.created_at as checkin_date
    FROM ticket_users tu
    JOIN tickets t ON t.ticket_user_id = tu.id
    LEFT JOIN checkin c ON c.ticket_user_id = tu.id AND c.event_id = p_event_id
    WHERE t.event_id = p_event_id
    AND (
        p_search_text = '' OR
        tu.name ILIKE '%' || p_search_text || '%' OR
        tu.email ILIKE '%' || p_search_text || '%' OR
        tu.document ILIKE '%' || p_search_text || '%' OR
        COALESCE(tu.qr_code, t.qr_code) ILIKE '%' || p_search_text || '%'
    )
    ORDER BY tu.name;
    
EXCEPTION
    WHEN OTHERS THEN
        RAISE NOTICE 'Erro na função search_participants_by_text: %', SQLERRM;
        -- Retornar resultado vazio em caso de erro
        RETURN;
END $$;


