--

CREATE FUNCTION public.sync_ticket_user_with_ticket() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Sincronizar dados do ticket para o ticket_user
    IF NEW.ticket_id IS NOT NULL THEN
        SELECT 
            t.ticket_type_name,
            t.ticket_area,
            t.ticket_sector,
            t.gender
        INTO 
            NEW.ticket_type_name,
            NEW.ticket_area,
            NEW.ticket_sector,
            NEW.gender
        FROM tickets t
        WHERE t.id = NEW.ticket_id;
    END IF;
    
    RETURN NEW;
END;
$$;


