--
-- Name: sync_ticket_with_type(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.sync_ticket_with_type() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Se ticket_type_id foi definido, buscar dados do tipo
    IF NEW.ticket_type_id IS NOT NULL THEN
        SELECT 
            ett.name,
            ett.area,
            ett.sector,
            CASE 
                WHEN NEW.gender = 'feminine' THEN ett.price_feminine
                ELSE ett.price
            END,
            ett.has_half_price
        INTO 
            NEW.ticket_type_name,
            NEW.ticket_area,
            NEW.ticket_sector,
            NEW.original_price,
            NEW.has_half_price
        FROM event_ticket_types ett
        WHERE ett.id = NEW.ticket_type_id;
    END IF;
    
    RETURN NEW;
END;
$$;


