--
-- Name: test_event_permissions(uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.test_event_permissions(event_id_param uuid) RETURNS TABLE(can_view boolean, can_edit boolean, can_delete boolean, reason text)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    event_record RECORD;
    user_id UUID;
    user_role TEXT;
BEGIN
    -- Obter usuário atual
    user_id := auth.uid();
    
    IF user_id IS NULL THEN
        RETURN QUERY SELECT FALSE, FALSE, FALSE, 'Usuário não autenticado';
        RETURN;
    END IF;
    
    -- Buscar evento
    SELECT * INTO event_record 
    FROM events 
    WHERE id = event_id_param;
    
    IF NOT FOUND THEN
        RETURN QUERY SELECT FALSE, FALSE, FALSE, 'Evento não encontrado';
        RETURN;
    END IF;
    
    -- Verificar role do usuário
    SELECT raw_user_meta_data->>'role' INTO user_role
    FROM auth.users 
    WHERE id = user_id;
    
    -- Verificar permissões
    RETURN QUERY SELECT 
        -- Pode visualizar
        (event_record.status = 'approved' OR 
         event_record.organizer_id = user_id OR 
         event_record.created_by = user_id OR 
         user_role = 'admin')::BOOLEAN as can_view,
        
        -- Pode editar
        (event_record.organizer_id = user_id OR 
         event_record.created_by = user_id OR 
         user_role = 'admin')::BOOLEAN as can_edit,
        
        -- Pode excluir
        (event_record.organizer_id = user_id OR 
         event_record.created_by = user_id OR 
         user_role = 'admin')::BOOLEAN as can_delete,
        
        CASE 
            WHEN user_role = 'admin' THEN 'Usuário é admin'
            WHEN event_record.organizer_id = user_id THEN 'Usuário é organizador'
            WHEN event_record.created_by = user_id THEN 'Usuário criou o evento'
            WHEN event_record.status = 'approved' THEN 'Evento aprovado (visualização pública)'
            ELSE 'Sem permissão'
        END as reason;
END;
$$;


ALTER FUNCTION public.test_event_permissions(event_id_param uuid) OWNER TO postgres;

