-- Name: ticket_users_after_ins_upd(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.ticket_users_after_ins_upd() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
    PERFORM set_config('search_path', 'public,pg_catalog', true);

    IF (TG_OP = 'INSERT' OR TG_OP = 'UPDATE') AND NEW.ticket_id IS NOT NULL THEN
        UPDATE public.tickets
        SET ticket_user_id = NEW.id
        WHERE id = NEW.ticket_id;
    END IF;

    RETURN NEW;
END;
$$;


ALTER FUNCTION public.ticket_users_after_ins_upd() OWNER TO postgres;

--
-- Name: ticket_users_before_ins_upd(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.ticket_users_before_ins_upd() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_ticket_id uuid;
BEGIN
    PERFORM set_config('search_path', 'public,pg_catalog', true);

    -- Se já vier com ticket_id, ok
    IF NEW.ticket_id IS NULL THEN
        -- Tenta por qr_code
        IF NEW.qr_code IS NOT NULL THEN
            SELECT id INTO v_ticket_id FROM public.tickets WHERE qr_code = NEW.qr_code LIMIT 1;
        END IF;

        -- Se ainda NULL, tenta por 'code' (apenas se houver um campo que faça sentido)
        -- (não assumimos mapeamento automático a menos que você confirme; desative se não usar)
        IF v_ticket_id IS NULL AND NEW.document IS NOT NULL THEN
            -- Exemplo: se document armazenar algum código de ticket você pode usar aqui
            -- SELECT id INTO v_ticket_id FROM public.tickets WHERE code = NEW.document LIMIT 1;
            -- Comentado por segurança — descomente e ajuste se de fato document contém code.
        END IF;

        IF v_ticket_id IS NOT NULL THEN
            NEW.ticket_id := v_ticket_id;
        ELSE
            -- Bloqueia a inserção com mensagem clara — evita violação silenciosa do NOT NULL
            RAISE EXCEPTION 'Inserção de ticket_user bloqueada: ticket_id ausente e não foi possível inferir por qr_code ou code. Envie ticket_id ou qr_code válido.';
        END IF;
    END IF;

    RETURN NEW;
END;
$$;


ALTER FUNCTION public.ticket_users_before_ins_upd() OWNER TO postgres;

--
-- Name: transfer_ticket(uuid, text, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.transfer_ticket(p_ticket_id uuid, p_new_user_email text, p_current_user_id uuid) RETURNS json
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_ticket_record RECORD;
  v_new_user_record RECORD;
  v_result JSON;
  v_transfer_log_id UUID;
BEGIN
  -- Verificar se o ingresso existe e pode ser transferido
  SELECT 
    t.id,
    t.event_id,
    t.ticket_type_id,
    t.user_id,
    t.ticket_user_id,
    t.status,
    t.transfer_count,
    COALESCE(ett.max_transfers, 1) as max_transfers,
    e.title as event_title,
    e.start_date
  INTO v_ticket_record
  FROM tickets t
  LEFT JOIN event_ticket_types ett ON t.ticket_type_id = ett.id
  JOIN events e ON t.event_id = e.id
  WHERE t.id = p_ticket_id;
  
  -- Verificar se o ingresso existe
  IF NOT FOUND THEN
    RETURN json_build_object(
      'success', false,
      'message', 'Ingresso não encontrado'
    );
  END IF;
  
  -- Verificar se o ingresso tem um proprietário definido (ticket_user_id)
  IF v_ticket_record.ticket_user_id IS NULL THEN
    RETURN json_build_object(
      'success', false,
      'message', 'Este ingresso não pode ser transferido pois não possui proprietário definido'
    );
  END IF;
  
  -- Verificar se o ingresso pertence ao usuário atual
  IF v_ticket_record.user_id != p_current_user_id THEN
    RETURN json_build_object(
      'success', false,
      'message', 'Você não pode transferir este ingresso'
    );
  END IF;
  
  -- Verificar se o ingresso já foi transferido o máximo de vezes
  IF v_ticket_record.transfer_count >= v_ticket_record.max_transfers THEN
    RETURN json_build_object(
      'success', false,
      'message', 'Este ingresso já atingiu o limite máximo de transferências'
    );
  END IF;
  
  -- Verificar se o evento ainda não começou
  IF v_ticket_record.start_date <= NOW() THEN
    RETURN json_build_object(
      'success', false,
      'message', 'Não é possível transferir ingressos para eventos que já começaram'
    );
  END IF;
  
  -- Verificar se o ingresso tem status válido
  IF v_ticket_record.status NOT IN ('active', 'confirmed') THEN
    RETURN json_build_object(
      'success', false,
      'message', 'Este ingresso não pode ser transferido no momento'
    );
  END IF;
  
  -- Buscar o novo usuário pelo email
  SELECT id, email, raw_user_meta_data->>'full_name' as full_name
  INTO v_new_user_record
  FROM auth.users
  WHERE email = p_new_user_email;
  
  -- Verificar se o novo usuário existe
  IF NOT FOUND THEN
    RETURN json_build_object(
      'success', false,
      'message', 'Usuário não encontrado com este email'
    );
  END IF;
  
  -- Verificar se não está tentando transferir para si mesmo
  IF v_new_user_record.id = p_current_user_id THEN
    RETURN json_build_object(
      'success', false,
      'message', 'Não é possível transferir o ingresso para você mesmo'
    );
  END IF;
  
  -- Iniciar transação
  BEGIN
    -- Atualizar o ingresso com o novo usuário
    UPDATE tickets 
    SET 
      user_id = v_new_user_record.id,
      transfer_count = transfer_count + 1,
      transferred_at = NOW(),
      transferred_by = p_current_user_id,
      updated_at = NOW()
    WHERE id = p_ticket_id;
    
    -- Registrar o log da transferência
    INSERT INTO ticket_transfers (
      id,
      ticket_id,
      from_user_id,
      to_user_id,
      transferred_at,
      transfer_reason,
      status
    ) VALUES (
      gen_random_uuid(),
      p_ticket_id,
      p_current_user_id,
      v_new_user_record.id,
      NOW(),
      'Transferência voluntária',
      'completed'
    );
    
    -- Retornar sucesso
    v_result := json_build_object(
      'success', true,
      'message', format('Ingresso transferido com sucesso para %s', 
        COALESCE(v_new_user_record.full_name, v_new_user_record.email)),
      'data', json_build_object(
        'ticket_id', p_ticket_id,
        'new_user_id', v_new_user_record.id,
        'new_user_name', COALESCE(v_new_user_record.full_name, v_new_user_record.email),
        'new_user_email', v_new_user_record.email,
        'transfer_count', v_ticket_record.transfer_count + 1,
        'max_transfers', v_ticket_record.max_transfers
      )
    );
    
    RETURN v_result;
    
  EXCEPTION WHEN OTHERS THEN
    -- Em caso de erro, fazer rollback
    RETURN json_build_object(
      'success', false,
      'message', 'Erro interno ao processar a transferência: ' || SQLERRM
    );
  END;
END;
$$;


ALTER FUNCTION public.transfer_ticket(p_ticket_id uuid, p_new_user_email text, p_current_user_id uuid) OWNER TO postgres;

--
-- Name: trigger_log_ticket_changes(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.trigger_log_ticket_changes() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  -- Registrar mudanças no status
  IF OLD.status != NEW.status THEN
    PERFORM log_ticket_action(
      NEW.id,
      'status_changed',
      auth.uid(),
      (SELECT name FROM profiles WHERE id = auth.uid()),
      (SELECT email FROM profiles WHERE id = auth.uid()),
      jsonb_build_object(
        'old_status', OLD.status,
        'new_status', NEW.status
      )
    );
  END IF;
  
  -- Registrar atribuição de usuário
  IF OLD.assigned_user_id IS NULL AND NEW.assigned_user_id IS NOT NULL THEN
    PERFORM log_ticket_action(
      NEW.id,
      'assigned',
      NEW.assigned_user_id,
      NEW.assigned_user_name,
      NEW.assigned_user_email,
      jsonb_build_object(
        'assigned_by', auth.uid(),
        'assigned_at', NEW.assigned_at
      )
    );
  END IF;
  
  -- Registrar check-in
  IF OLD.check_in_date IS NULL AND NEW.check_in_date IS NOT NULL THEN
    PERFORM log_ticket_action(
      NEW.id,
      'checked_in',
      NEW.assigned_user_id,
      NEW.assigned_user_name,
      NEW.assigned_user_email,
      jsonb_build_object(
        'check_in_by', NEW.check_in_by,
        'check_in_location', NEW.check_in_location
      )
    );
  END IF;
  
  -- Registrar uso
  IF OLD.is_used = false AND NEW.is_used = true THEN
    PERFORM log_ticket_action(
      NEW.id,
      'used',
      NEW.assigned_user_id,
      NEW.assigned_user_name,
      NEW.assigned_user_email,
      jsonb_build_object(
        'used_by', NEW.used_by,
        'used_at', NEW.used_at
      )
    );
  END IF;
  
  RETURN NEW;
END;
$$;


