--
-- Name: update_order_status(uuid, character varying, character varying, jsonb); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.update_order_status(p_order_id uuid, p_new_status character varying, p_reason character varying DEFAULT NULL::character varying, p_webhook_data jsonb DEFAULT '{}'::jsonb) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_old_status VARCHAR(20);
BEGIN
  -- Obter status atual
  SELECT payment_status INTO v_old_status 
  FROM orders WHERE id = p_order_id;
  
  IF NOT FOUND THEN
    RETURN FALSE;
  END IF;
  
  -- Atualizar status
  UPDATE orders 
  SET payment_status = p_new_status,
      updated_at = NOW(),
      paid_at = CASE WHEN p_new_status = 'paid' THEN NOW() ELSE paid_at END,
      canceled_at = CASE WHEN p_new_status = 'canceled' THEN NOW() ELSE canceled_at END
  WHERE id = p_order_id;
  
  -- Registrar no histórico
  INSERT INTO payment_history (
    order_id, old_status, new_status, change_reason, webhook_data
  ) VALUES (
    p_order_id, v_old_status, p_new_status, p_reason, p_webhook_data
  );
  
  RETURN TRUE;
END;
$$;


