--
-- Name: auto_withdrawals_monitoring; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.auto_withdrawals_monitoring AS
 SELECT w.id,
    w.organizer_id,
    p.name AS organizer_name,
    w.auto_withdrawal_enabled,
    w.auto_trigger_type,
    w.sales_amount_trigger,
    w.sales_count_trigger,
    w.time_interval_days,
    w.withdrawal_limit,
    w.last_auto_execution,
    w.next_scheduled_execution,
    w.status,
    w.amount
   FROM (public.withdrawals w
     JOIN public.profiles p ON ((w.organizer_id = p.id)))
  WHERE (w.auto_withdrawal_enabled = true)
  ORDER BY w.next_scheduled_execution;


