--
-- Name: events_with_ticket_types; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.events_with_ticket_types AS
 SELECT id,
    title,
    description,
    organizer_id,
    start_date,
    end_date,
    location,
    status,
    created_at,
    updated_at,
    image,
    price,
    available_tickets,
    total_tickets,
    category,
    tags,
    banner_metadata,
    banner_alt_text,
    carousel_approved,
    carousel_priority,
    reviewed_at,
    reviewed_by,
    rejection_reason,
    subject,
    subcategory,
    location_type,
    location_name,
    location_city,
    location_state,
    location_street,
    location_number,
    location_neighborhood,
    location_cep,
    location_complement,
    location_search,
    ticket_type,
    image_size,
    image_format,
    created_by,
    sold_tickets,
    max_tickets_per_user,
    min_tickets_per_user,
    ticket_sales_start,
    ticket_sales_end,
    address,
    classification,
    important_info,
    attractions,
    COALESCE(( SELECT json_agg(json_build_object('id', ett.id, 'title', ett.title, 'name', ett.name, 'price', ett.price, 'price_type', ett.price_type, 'price_masculine', ett.price_masculine, 'price_feminine', ett.price_feminine, 'half_price_title', ett.half_price_title, 'half_price_quantity', ett.half_price_quantity, 'half_price_price', ett.half_price_price, 'half_price_price_feminine', ett.half_price_price_feminine, 'quantity', ett.quantity, 'available_quantity', ett.available_quantity, 'status', ett.status, 'batches', ( SELECT json_agg(json_build_object('id', tb.id, 'batch_number', tb.batch_number, 'quantity', tb.quantity, 'price_type', tb.price_type, 'price', tb.price, 'price_feminine', tb.price_feminine, 'sale_start_date', tb.sale_start_date, 'sale_start_time', tb.sale_start_time, 'sale_end_date', tb.sale_end_date, 'sale_end_time', tb.sale_end_time) ORDER BY tb.batch_number) FILTER (WHERE (tb.id IS NOT NULL)) AS json_agg
                   FROM public.event_ticket_batches tb
                  WHERE (tb.ticket_type_id = ett.id)))) AS json_agg
           FROM public.event_ticket_types ett
          WHERE ((ett.event_id = e.id) AND (ett.status = 'active'::text))), '[]'::json) AS ticket_types
   FROM public.events e;


ALTER VIEW public.events_with_ticket_types OWNER TO postgres;

