--
-- Name: ticket_types_with_batches _RETURN; Type: RULE; Schema: public; Owner: postgres
--

CREATE OR REPLACE VIEW public.ticket_types_with_batches AS
 SELECT ett.id,
    ett.event_id,
    ett.name,
    ett.title,
    ett.description,
    ett.price,
    ett.price_masculine,
    ett.price_feminine,
    ett.price_type,
    ett.quantity,
    ett.available_quantity,
    ett.min_quantity,
    ett.max_quantity,
    ett.has_half_price,
    ett.half_price_title,
    ett.half_price_quantity,
    ett.half_price_price,
    ett.half_price_price_feminine,
    ett.sector,
    ett.benefits,
    ett.ticket_type,
    ett.status,
    ett.sale_start_date,
    ett.sale_end_date,
    ett.sale_period_type,
    ett.availability,
    ett.service_fee_type,
    ett.character_limit,
    ett.description_limit,
    ett.created_at,
    ett.updated_at,
    COALESCE(json_agg(json_build_object('id', tb.id, 'batch_number', tb.batch_number, 'quantity', tb.quantity, 'price_type', tb.price_type, 'price', tb.price, 'price_feminine', tb.price_feminine, 'sale_start_date', tb.sale_start_date, 'sale_start_time', tb.sale_start_time, 'sale_end_date', tb.sale_end_date, 'sale_end_time', tb.sale_end_time, 'created_at', tb.created_at, 'updated_at', tb.updated_at) ORDER BY tb.batch_number) FILTER (WHERE (tb.id IS NOT NULL)), '[]'::json) AS batches
   FROM (public.event_ticket_types ett
     LEFT JOIN public.event_ticket_batches tb ON ((tb.ticket_type_id = ett.id)))
  GROUP BY ett.id;


